import React from "react";
import { Icon } from "Shared/svg/Icon";
import { useDispatch, useSelector } from "react-redux";
import { nextPage, previousPage, selectPage } from "Features/store/pageSlice";
import { MenuConteiner, ButtonConteiner } from "./style";
import styled from "styled-components";

export default function HeaderMenu() {
  const dispatch = useDispatch();
  const companyPageActive = () => dispatch(nextPage());
  const personPageActive = () => dispatch(previousPage());
  const page_props = useSelector(selectPage);
  const MenuConteiner = styled.div`
    font-family: "TTFirsNeue400";
    margin: 50px auto 19px;
    width: 647px;
    height: 17px;
    display: flex;
    justify-content: space-between;
    @media (max-width: 768px) {
      display: none;
    }
  `;
  return (
    <div>
      <MenuConteiner>
        <ButtonConteiner page_props={page_props} onClick={companyPageActive}>
          <Icon id="arrow" className="arrow-icon left" /> о сотруднике
        </ButtonConteiner>
        <ButtonConteiner page_props={!page_props} onClick={personPageActive}>
          о компании
          <Icon id="arrow" className="arrow-icon right" />
        </ButtonConteiner>
      </MenuConteiner>
    </div>
  );
}
